(578, 3, 'Google Glass - friend or foe?', 'http://www.bbc.co.uk/news/technology-21699307#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Will Google Glass change our lives?', 1367799406, 'http://www.bbc.co.uk/news/technology-21699307'),
(579, 3, 'Making apps for not-so-smartphones', 'http://www.bbc.co.uk/news/business-22390444#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'The developers exploiting the market for ''feature phone'' apps', 1367881404, 'http://www.bbc.co.uk/news/business-22390444'),
(580, 3, 'Microsoft''s Windows 8 under fire', 'http://www.bbc.co.uk/news/technology-22439496#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Microsoft faces claims that its operating system is a "failure"', 1367939214, 'http://www.bbc.co.uk/news/technology-22439496'),
(581, 3, 'AUDIO: ''Grey area for social media''', 'http://www.bbc.co.uk/news/technology-22382814#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Stephen Balkam of the Family Online Safety Institute (Fosi) discusses the difficulties social media organisations face in moderating content', 1367503224, 'http://www.bbc.co.uk/news/technology-22382814'),
(582, 3, 'VIDEO: Webscape: Slow motion video', 'http://www.bbc.co.uk/news/world-radio-and-tv-22396050#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Kate Russell looks at slow motion videos, plus other websites and apps reviewed.', 1367584277, 'http://www.bbc.co.uk/news/world-radio-and-tv-22396050'),
(583, 3, 'VIDEO: Buffett''s ''Woodstock for capitalists''', 'http://www.bbc.co.uk/news/business-22396405#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Legendary US investor Warren Buffett will host his annual shareholder meeting this weekend with almost 35,000 investors in attendance.', 1367571704, 'http://www.bbc.co.uk/news/business-22396405'),
(584, 3, 'VIDEO: World''s smallest flying robot built', 'http://www.bbc.co.uk/news/science-environment-22393858#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Scientists in the US have created a robot the size of a fly that is able to perform the agile manoeuvres of the ubiquitous insects.', 1367556533, 'http://www.bbc.co.uk/news/science-environment-22393858'),
(585, 3, 'AUDIO: Smartphones ''as addictive as cocaine''', 'http://www.bbc.co.uk/news/business-22397932#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'John Benson from Blackpool says he lost his relationship and his job because he was addicted to his smartphone.', 1367580874, 'http://www.bbc.co.uk/news/business-22397932'),
(586, 3, 'VIDEO: Flyunder for Hammersmith flyover', 'http://www.bbc.co.uk/news/uk-england-london-22412213#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'A group of London architects has proposed a flyunder to replace Hammersmith''s "terrible" flyover.', 1367671213, 'http://www.bbc.co.uk/news/uk-england-london-22412213'),
(587, 3, 'VIDEO: Giant solar plane lands in Phoenix', 'http://www.bbc.co.uk/news/science-environment-22414444#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'A solar-powered aircraft that developers hope to eventually pilot around the world has landed in Phoenix Arizona on the first leg of a flight across America.', 1367691654, 'http://www.bbc.co.uk/news/science-environment-22414444'),
(588, 3, 'VIDEO: 180 degree television for the home?', 'http://www.bbc.co.uk/news/magazine-22315685#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'BBC News takes a look at a new filming and projection technique which aims to create an enhanced, immersive experience, augmenting traditional screen viewing.', 1367548577, 'http://www.bbc.co.uk/news/magazine-22315685'),
(589, 3, 'VIDEO: Is it the end of SMS text messaging?', 'http://www.bbc.co.uk/news/technology-22382894#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Instant messaging on chat apps like WhatsApp have overtaken the traditional SMS text message.', 1367582794, 'http://www.bbc.co.uk/news/technology-22382894'),
(590, 3, 'VIDEO: Should Google pay for the internet?', 'http://www.bbc.co.uk/news/22387461#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'David Reid looks at net neutrality, with one internet provider cutting off users from some Google content', 1367912337, 'http://www.bbc.co.uk/news/22387461'),
(591, 3, 'Virtual worm wriggling into life', 'http://www.bbc.co.uk/news/technology-22397252#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'A virtual worm that acts just like its real world counterparts could soon be inhabiting your web browser.', 1367582098, 'http://www.bbc.co.uk/news/technology-22397252'),
(592, 3, 'Satellite to monitor Earth''s forests', 'http://www.bbc.co.uk/news/science-environment-22435656#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'A satellite that can "weigh" the Earth''s forests has just been given the go ahead by the European Space Agency.', 1367935257, 'http://www.bbc.co.uk/news/science-environment-22435656'),
(593, 3, 'Phisher pupils hack class computers', 'http://www.bbc.co.uk/news/technology-22398484#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'A group of children in Alaska took over their classroom computers after phishing account details from teachers.', 1367578496, 'http://www.bbc.co.uk/news/technology-22398484'),
(594, 3, 'Warner Bros sued in viral cats row', 'http://www.bbc.co.uk/news/technology-22397446#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Creators of Nyan Cat and Keyboard Cat sue Warner Bros over use of the characters in video game series.', 1367583172, 'http://www.bbc.co.uk/news/technology-22397446'),
(595, 3, 'Planning changes to boost mobile web', 'http://www.bbc.co.uk/news/technology-22398608#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Mobile operators could find it easier to put up mobile masts and antenna in England under suggested changes to planning laws.', 1367600448, 'http://www.bbc.co.uk/news/technology-22398608'),
(596, 3, 'US military to adopt Android phones', 'http://www.bbc.co.uk/news/technology-22395602#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Samsung phones running a secure version of Android have been approved for use by the US Department of Defense.', 1367574856, 'http://www.bbc.co.uk/news/technology-22395602'),
(597, 3, 'Amazon beats Google with China apps', 'http://www.bbc.co.uk/news/technology-22425384#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Amazon has beaten Google to become the first Western firm to launch a paid-for app store for Android phones in China.', 1367839894, 'http://www.bbc.co.uk/news/technology-22425384');
INSERT INTO `aggregator_item` (`iid`, `fid`, `title`, `link`, `author`, `description`, `timestamp`, `guid`) VALUES
(598, 3, 'Senate backs online sales tax plan', 'http://www.bbc.co.uk/news/world-us-canada-22426764#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'An online sales tax bill heads to the US House of Representatives after Senate passage, as brick-and-mortar shops call for a "level playing field".', 1367884270, 'http://www.bbc.co.uk/news/world-us-canada-22426764'),
(599, 3, 'Poster ''only fully visible to kids''', 'http://www.bbc.co.uk/news/technology-22425388#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'A poster printed in such a way as to only allow children to see the full image has been used in an anti-abuse campaign in Spain.', 1367853498, 'http://www.bbc.co.uk/news/technology-22425388'),
(600, 3, 'US accuses China of cyber-spying', 'http://www.bbc.co.uk/news/world-asia-china-22430224#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'China''s government and military have targeted US government computers as part of a cyber espionage campaign, a US report on China says.', 1367921042, 'http://www.bbc.co.uk/news/world-asia-china-22430224'),
(601, 3, 'Motorola ''abused patent position''', 'http://www.bbc.co.uk/news/technology-22425387#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Motorola "abused its position" when it filed a patent injunction against Apple in Germany, EU officials say.', 1367861472, 'http://www.bbc.co.uk/news/technology-22425387'),
(602, 3, 'World''s first 3D-printer gun fired', 'http://www.bbc.co.uk/news/science-environment-22421185#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'The world’s first gun made using a 3D printer is successfully tested in the US by a group planning to make the blueprints available online.', 1367822301, 'http://www.bbc.co.uk/news/science-environment-22421185'),
(603, 3, 'Syrian hackers hit the Onion', 'http://www.bbc.co.uk/news/technology-22435872#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'The Twitter feed of satire site The Onion has fallen victim to hackers from The Syrian Electronic Army.', 1367928413, 'http://www.bbc.co.uk/news/technology-22435872'),
(604, 3, 'Google Glass not for kids under 13', 'http://www.bbc.co.uk/newsround/22430822#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Google says children under 13 should not use Google Glass, because the upcoming smart specs "could harm developing vision".', 1367930247, 'http://www.bbc.co.uk/newsround/22430822'),
(605, 3, 'US extradites cybercrime suspect', 'http://www.bbc.co.uk/news/technology-22432178#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'A 24-year-old Algerian man has been extradited to the US to face charges that he stole cash from more than 250 American banks.', 1367927211, 'http://www.bbc.co.uk/news/technology-22432178'),
(606, 3, 'Google''s Russian test-case fails', 'http://www.bbc.co.uk/news/technology-22433861#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'An appeal lodged by Google over the removal of a YouTube clip in Russia has been thrown out by a Moscow court.', 1367923811, 'http://www.bbc.co.uk/news/technology-22433861'),
(607, 3, 'Twitter use defeats distance barrier', 'http://www.bbc.co.uk/news/technology-22436985#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Twitter is eliminating distance and helping people stay in touch with faraway friends and acquaintances, suggests a study of the social network.', 1367944342, 'http://www.bbc.co.uk/news/technology-22436985'),
(608, 3, 'Glowing plant gets funds green light', 'http://www.bbc.co.uk/news/technology-22433866#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'A DIY project to create a glowing plant has proved a big hit on the crowdfunding site Kickstarter.', 1367935597, 'http://www.bbc.co.uk/news/technology-22433866'),
(609, 3, 'Photoshop moves to subscription', 'http://www.bbc.co.uk/news/technology-22432171#sa-ns_mchannel=rss&ns_source=PublicRSS20-sa', '', 'Adobe is introducing a subscription model for many of its most popular programs, including Photoshop, Illustrator, Dreamweaver and Premiere.', 1367923553, 'http://www.bbc.co.uk/news/technology-22432171');
